import React from "react";

const Projects = () => {
  return (
    <div id="projects">
      <div className="section_title">
        <h1>Projects</h1>
      </div>
      <div className="section_content">
        <div className="project">
          <div className="name">02. Arcade Game</div>
        </div>
      </div>
    </div>
  );
};

export default Projects;
